import React, {useState} from 'react';
import styled from 'styled-components';
import { Collapse, Button, CardBody, Card } from 'reactstrap';

function Subcategory({subcategory, bookmarks}) {
    console.log("Passed down bookmarks",bookmarks);
    console.log("subcategory", subcategory)

    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return(
        <div>
            <button color="primary" onClick={toggle} style={{ marginBottom: '1rem' }}>{subcategory}</button>
            <Collapse isOpen={isOpen}>
                <Card>
                <CardBody>
                    {
                        bookmarks.map(bookmark => {
                            return <a key={bookmark.id} href={bookmark.url}>{bookmark.name}</a>
                        })
                    }
                </CardBody>
                </Card>
            </Collapse>
        </div>
    )
}
export default Subcategory;
